import { Link } from 'react-router-dom'
import styled, {css} from 'styled-components';
import { Button, Icon } from 'xsolla-uikit';

export function AddSection({handle}) {
  return (
    <Button onClick={handle}
    appearance='secondary'
    size='sm'
  >
      <Icon />
      Add Section
  </Button>
  )
}
